var elncn,elnncn,upcn=0,tosave=[],toload=[[""]],b64="";function exportSave(){b64=b64Encode(JSON.stringify([[elncn,elnncn,upcn],[0,0,tosave],"["+JSON.stringify(toload)+"]"]))}function b64Encode(a){return window.btoa(unescape(encodeURIComponent(a)))}function b64Decode(a){return decodeURIComponent(escape(window.atob(a)))}function loadInfo(a){var b=JSON.parse(b64Decode(a));elncn=b[0][0],elnncn=b[0][1],upcn=b[0][2],tosave=b[1][2],toload=b[2]}function updateIds(){document.getElementById("elncns").value=elncn,document.getElementById("elnncns").value=elnncn,document.getElementById("upcns").value=upcn,document.getElementById("tosaves").value=tosave,document.getElementById("toloads").value=toload,document.getElementById("b64s").value=b64}function updateVars(){elncn=document.getElementById("elncns").value,elnncn=document.getElementById("elnncns").value,upcn=document.getElementById("upcns").value,tosave=document.getElementById("tosaves").value,toload=document.getElementById("toloads").value,b64=document.getElementById("b64s").value}